import React, { Component } from 'react'
import "../../Css/EditProfile.css";

export default class EditProfile extends Component {
     constructor(){
         super();
             this.state = {
                 name: '',
                 phone: '',
                 profession:'',
                 hourlyRate:'',
                 availibilty:'',
                 age:'',
                 address:'',
                 experience:''
             };
         this.onChange = this.onChange.bind(this);
         this.onSubmit = this.onSubmit.bind(this);

     }
    //  componentWillReceiveProps(nextProps){
    //         if(nextProps.errors){
    //             this.setState({
    //                 errors: nextProps.errors
    //             });
    //         }
    //  }
     onChange(e){
         this.setState({[e.target.name]: e.target.value});
     }
      onSubmit(e){
         e.preventDefault();

         const newUser = {
           email: this.state.email,
           password: this.state.password,
         };
         this.props.register(newUser, this.props.history);
     }
    render() {
        return (
            <div className="editProfile">
                <div className="navName">
                    <h4>Edit Profile</h4>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quos, quaerat eaque. Harum sunt explicabo quam minima veniam possimus odit officiis?</p>
                </div>
                <hr/>
                <div className="editProfile_body">
                     <form onSubmit={this.onSubmit}>
                    <h5>Name</h5>
                    <input type='text'  
                    name= 'name'
                    value={this.state.name} 
                    onChange={this.onChange} 
                     />

                    <h5>Phone</h5>
                    <input type='text'
                     name= 'phone'
                      value={this.state.name}
                     onChange={this.onChange}  
                             />

                             <h5>Profession</h5>
                    <input type='text'  
                    name= 'profession'
                    value={this.state.name} 
                    onChange={this.onChange} 
                     />

                    <h5>Hourly Rate</h5>
                    <input type='text'
                     name= 'hourlyRate'
                      value={this.state.name}
                     onChange={this.onChange}  
                             />
                             <h5>Experience</h5>
                    <input type='text'  
                    name= 'experience'
                    value={this.state.name} 
                    onChange={this.onChange} 
                     />

                    <h5>Availibilty</h5>
                    <input type='text'
                     name= 'availibilty'
                      value={this.state.name}
                     onChange={this.onChange}  
                             />
                             
                    <h5>Age</h5>
                    <input type='text'
                     name= 'age'
                      value={this.state.name}
                     onChange={this.onChange}  
                             />
                                        
                    <h5>Address</h5>
                    <input type='text'
                     name= 'address'
                      value={this.state.name}
                     onChange={this.onChange}  
                             />
                
                        <button type='submit' className='formSubmit'>Submit</button>
                </form>
                </div>
            </div>
        )
    }
}
